[[File:Tamayu chathead.png|left]]
'''Tamayu''' is the eldest son of the chief of [[Tai Bwo Wannai]], [[Timfraku]],and one of the brothers in [[Tai Bwo Wannai Trio]]. His father describes him as a natural born hunter, killing his first monkey at the age of three. During the quest he can be found south-east of Tai Bwo Wannai near the mining spot. To avenge the deaths of his kin, he must hunt their killer, [[The Shaikahan]]. To be successful, he needs a [[steel spear]], or better, with [[Karambwan paste|Karambwan poison]] and some [[Agility potion]]s. When give to him by the payer, and defeating The Shaikahan, he will be more friendly to the player.

During the quest the player needs to bring a monkey corpse to him. He will then skin it and give back monkey skin and bones, which are used with [[seaweed]] to create a [[seaweed sandwich]] to [[Tinsay]]. After the quest is complete, he can be found in the village of [[Tai Bwo Wannai]] where he runs a [[Tamayu's Spear Stall|spear stall]].

